import './contact.styles.scss';

const Contact = ({ active, contact }) => {
  const { username } = contact;
  console.log('active from', username, active);
  console.log(typeof active);

  const classAddendum = active ? 'active' : '';

  console.log(classAddendum, 'from', username);

  return (
    <li name={username} className={`contact-list-item ${classAddendum}`}>
      {username}
    </li>
  );
};

export default Contact;
